export default function phaseToString(phase) {
    return (
        (phase === 1) ?  "Mise à jour des ressources" :
            (phase === 2) ? "Élaboration de la stratégie" :
                (phase === 3) ? "Choix des actions" :
                    (phase === 4) ? "Découverte des événements" :
                        (phase === 5) ? "Réunion collaborative" :
                            (phase === 6) ? "Satisfaction" :
                                (phase === 7) ? "Résultats" :
                                    null
    );
}
